import React from "react";
import PropTypes from 'prop-types';

class FormResidencia extends React.Component{
  render() {
    const { handler, residencia } = this.props;
    return(
      <fieldset>
        <label>
          Residencia:
          <label>
            <input
              type="radio"
              name='residencia'
              value={residencia}
              onChange={handler}
              maxLength="28">
            </input>
          Casa</label>
        </label>
      </fieldset>
    )
  }
}

FormResidencia.propTypes = {
  handler: PropTypes.func.isRequired,
  residencia: PropTypes.string.isRequired,
};

export default FormResidencia;
